import React from "react";
import "./App.css";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import "./container.css"
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import PatientLogin from "./Pages/PatientLogin";
import Navbar from "./components/Navbar.js";
import DoctorLogin from "./Pages/DoctorLogin.js";
import Pdashboard from "./Pages/Pdashboard.js";
import DoctorDashboard from "./Pages/Ddashboard.js";
import SideNavbar from "./components/sidenavbar.js";
import PreviousAppointments from "./Pages/Appointment.js";
import UploadSchedule from "./Pages/uploadschedule.js";

function App() {
  return (
    <Router>
      <div className="app-container">
        <Navbar />
        <div className="main-container">
          <SideNavbar />
          <Routes>
            <Route exact path="/" element={<PatientLogin />} />
            <Route exact path="/dlogin" element={<DoctorLogin />} />
            <Route exact path="/pdashboard" element={<Pdashboard />} />
            <Route exact path="/ddashboard" element={<DoctorDashboard />} />
            <Route
              exact
              path="/ddashboard/appointment"
              element={<PreviousAppointments />}
            />
            <Route
              exact
              path="/ddashboard/upload"
              element={<UploadSchedule />}
            />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
